    <title>Login Page2</title>
    <style>
       *{
            margin:0px;
            padding:0px;
        }
        .login_page_background{
            width:100vw;
            height:100vh;
            overflow: hidden;
            position: relative;
        }
        #Layer_6{
            animation: move1 3s infinite linear alternate-reverse;
        }
        @keyframes move1{
            0%{
                transform: translate(10px, 10px);
                opacity: 0;
            }
            100%{
                transform: translate(30px, 30px);
                opacity: 1;
            }
        }
        #Layer_4{
            animation: move2 2s infinite linear alternate-reverse;
        }
        @keyframes move2{
            0%{
                transform: translate(-10px, -20px);
                opacity: 0;
            }
            100%{
                transform: translate(-40px, -20px);
                opacity: 1;
            }
        }
        #Layer_10, #Layer_7{
            animation: move3 6s infinite linear;
        }
        @keyframes move3{
            0%{
                transform: translate(-10px, -20px);
                opacity: 0;
            }
            40%{
                transform: translate(20px, 50px);
                opacity: 1;
            }
            70%{
                transform: translate(-30px, 60px);
                opacity: 1;
            }
            100%{
                transform: translate(80px, -80px);
                opacity: 0;
            }
        }
        #Layer_9{
            animation: move4 10s infinite linear;
        }
        @keyframes move4{
            0%{
                transform: translate(-5px, -10px);
                opacity: 0;
            }
            40%{
                transform: translate(30px, 20px);
                opacity: 1;
            }
            70%{
                transform: translate(20px, -40px);
                opacity: 1;
            }
            100%{
                transform: translate(-50px, 60px);
                opacity: 0;
            }
        }
        #satlight{
            animation: satlight 5s infinite linear alternate-reverse;
        }
        @keyframes satlight{
            0%{
                transform: translate(-5px, -10px);
            }
            100%{
                transform: translate(75px, -10px);
            }
        }
        #whiteStars{
            animation: satlight 5s infinite linear alternate-reverse;
        }
        @keyframes satlight{
            0%{
                opacity: 0;
                transform: translate(-5px, -10px);
            }
            50%{
                opacity: 1;
                transform: translate(5px, 10px);
            }
        }
        #Layer_8{
            animation: move10 5s infinite linear alternate-reverse;
        }
        @keyframes move10{
            0%{
                transform: translate(75px, -10px);
            }
            100%{
                transform: translate(-5px, -10px);
            }
        }
        #spaceMan{
            animation: spaceman 10s infinite alternate-reverse;
            transform-origin: center;
            
        }
        @keyframes spaceman{
            0%{
                transform: translate(10px, 10px)
                rotate(6deg);
            }
            30%{
                transform: translate(-15px, -15px)
                rotate(-13deg);
            }
            60%{
                transform: translate(20px, -30px)
                rotate(5deg);
            }
            80%{
                transform: translate(30px, 30px)
                rotate(40deg);
            }
            100%{
                transform: translate(10px, 10px)
                rotate(0deg);
            }
        }
        #Rocket1{
            opacity: 0;
            animation: rocket1 12s infinite linear;
        }
        @keyframes rocket1{
            0%{
                transform: translate(50px, 50px);
                opacity: 1;
            }
            70%{
                transform: translate(1200px, -1300px);
                opacity: 1;
            }
            71%, 100%{
                opacity: 0;
            }
        }
        #rocket2{
            opacity: 0;
            animation: rocket2 19s infinite linear;
            animation-delay: 2s
        }
        @keyframes rocket2{
            0%{
                transform: translate(-10px, -10px);
                opacity: 1;
            }
            70%{
                transform: translate(1200px, 1000px);
                opacity: 1;
            }
            71%, 100%{
                opacity: 0;
            }
        }
        #yellowstar{
            animation : yellowstar 5s infinite linear;
        }
        @keyframes yellowstar{
            0%{
                opacity: 0;
            }
            40%{
                opacity: 2;
            }
            41%, 100%{
                opacity: 1;
            }
        }
        #yellowstar2{
            animation : yellowstar2 7s infinite linear;
            animation-delay: 1s;
        }
        @keyframes yellowstar2{
            0%{
                opacity: 0;
            }
            40%{
                opacity: 2;
            }
            41%, 100%{
                opacity: 1;
            }
        }
